export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},wIF8rERUOH:{data:{id:196,attributes:{imdbId:"tt0120594",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTM5MzIzMDAxNV5BMl5BanBnXkFtZTcwNTc2NzAyMQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"},{Source:"Metacritic",Value:"49\u002F100"}],item_lang:{data:{id:859,attributes:{title:"B. Monkey",plot:"Alan Furnace is a young man with the perfectly proper, quiet life of a London school teacher. But beneath all of that decency lies a burning desire for excitement and he just found it. She's a woman unlike any other: Unruly Irish eyes, Latin lips... her name is Beatrice, but on the streets they call her B. Monkey. She's about to take him on an outrageous, dangerous and sexy ride through the wild side of London.",slug:"b-monkey"}}},books:{data:[{id:491,attributes:{title:g,description:h,thumbnail:i,authors:[c],firstBook:true,published:j,publisher:k,subtitle:a}},{id:492,attributes:{title:g,description:h,thumbnail:i,authors:[c],firstBook:d,published:j,publisher:k,subtitle:a}},{id:493,attributes:{title:"B Monkey Window Sticker",description:a,thumbnail:a,authors:[c],firstBook:d,published:"1993-03-01",publisher:"Arrow",subtitle:a}},{id:494,attributes:{title:"Getting Hurt",description:"Charlie Cross is a solicitor, a divorcee, an animal lover, a drinker, and a smoker. He is intelligent, strong, highly respected—and he is heading for trouble. When Charlie meets Viola in an after-hours drinking club, he knows instinctively that they could do each other harm. Nonetheless, he quickly falls in love with her and throughout their torrid affair he keeps an extensive journal. Charlie's voice—honest, funny, and perplexed—embodies all the complexities of male experience. He speaks from the heart and charts the peaks of eroticism and the depths of emotional pain that define his heart-wrenching relationship.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SlQRGQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2007-07-01",publisher:"Little Books",subtitle:a}},{id:495,attributes:{title:"Ecology and Genetics of Color Vision in Callicebus Brunneus, a Neotropical Monkey",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CmkMFFj46jIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["John Andrew Bunce"],firstBook:d,published:"2009-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377199474}}("","movie","Andrew Davies",null,"series",1,"B Monkey","Read her name! B. Monkey. You can still see it, emblazoned on the cars, the trains, the writing on the wall. Now she's Beatrice. Steady job, steady man, off the drugs, on the level. But going straight can't compare with the heady thrill of life on the edge. Not when the past keeps hooking in to the present. Not when Alan, her love, her rescuer, her future, can never hope to understand...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1CZzz-NpR9AC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-12-31","Random House"))